import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { FiUser, FiBookOpen, FiTarget, FiHeart } from 'react-icons/fi';

const StoryContainer = styled.div`
  min-height: 100vh;
  padding: 120px 20px 60px;
  background: ${props => props.theme.background};
`;

const StoryContent = styled.div`
  max-width: 1200px;
  margin: 0 auto;
`;

const StoryHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 4rem;
`;

const StoryTitle = styled.h1`
  font-size: clamp(2.5rem, 5vw, 4rem);
  font-weight: 700;
  background: linear-gradient(-45deg, ${props => props.theme.primary}, ${props => props.theme.secondary}, ${props => props.theme.accent});
  background-size: 400% 400%;
  animation: gradient 3s ease infinite;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  margin-bottom: 1rem;
`;

const StorySubtitle = styled.p`
  font-size: 1.2rem;
  color: ${props => props.theme.textSecondary};
  max-width: 600px;
  margin: 0 auto;
  line-height: 1.6;
`;

const StorySection = styled(motion.div)`
  margin-bottom: 4rem;
  padding: 2rem;
  background: ${props => props.theme.surface};
  border-radius: 20px;
  border: 1px solid ${props => props.theme.border};
  box-shadow: 0 10px 30px ${props => props.theme.shadow};
`;

const SectionHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 1rem;
  margin-bottom: 1.5rem;
`;

const SectionIcon = styled.div`
  width: 50px;
  height: 50px;
  border-radius: 50%;
  background: linear-gradient(135deg, ${props => props.theme.primary}, ${props => props.theme.secondary});
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: 1.5rem;
`;

const SectionTitle = styled.h2`
  font-size: 1.8rem;
  color: ${props => props.theme.text};
  margin: 0;
`;

const SectionContent = styled.div`
  color: ${props => props.theme.textSecondary};
  line-height: 1.7;
  font-size: 1.1rem;
`;

const Timeline = styled.div`
  position: relative;
  padding-left: 2rem;

  &::before {
    content: '';
    position: absolute;
    left: 0;
    top: 0;
    bottom: 0;
    width: 2px;
    background: linear-gradient(to bottom, ${props => props.theme.primary}, ${props => props.theme.secondary});
  }
`;

const TimelineItem = styled.div`
  position: relative;
  margin-bottom: 2rem;
  padding-left: 2rem;

  &::before {
    content: '';
    position: absolute;
    left: -1.5rem;
    top: 0.5rem;
    width: 12px;
    height: 12px;
    border-radius: 50%;
    background: ${props => props.theme.accent};
    border: 3px solid ${props => props.theme.background};
  }
`;

const TimelineYear = styled.div`
  font-weight: 600;
  color: ${props => props.theme.primary};
  font-size: 1.1rem;
  margin-bottom: 0.5rem;
`;

const TimelineText = styled.p`
  color: ${props => props.theme.textSecondary};
  margin: 0;
`;

const MyStory = ({ theme }) => {
  return (
    <StoryContainer theme={theme}>
      <StoryContent>
        <StoryHeader
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          <StoryTitle theme={theme}>My Story</StoryTitle>
          <StorySubtitle theme={theme}>
            From passion to profession - here's the journey that shaped me into the developer I am today.
          </StorySubtitle>
        </StoryHeader>

        <AboutSection
            initial={{ opacity: 0, x: -30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.2 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiUser />
            </SectionIcon>
            <SectionTitle theme={theme}>Who I Am</SectionTitle>
            <SectionContent theme={theme}>
              I'm an analytical Data Analyst and Software Developer based in Ontario, Canada, with a passion for 
              socio-economic modeling and large-scale data processing. My journey began with a curiosity about 
              how data can drive meaningful decisions, which evolved into expertise in AI-driven automation and 
              evidence-based policymaking. Currently working at Intact Insurance, I specialize in developing 
              scalable backend services that process massive datasets and create actionable insights.
            </SectionContent>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, x: 30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6, delay: 0.4 }}
            theme={theme}
          >
            <SectionIcon theme={theme}>
              <FiTarget />
            </SectionIcon>
            <SectionTitle theme={theme}>My Mission</SectionTitle>
            <SectionContent theme={theme}>
              To leverage cutting-edge technology and data science to solve complex business challenges. I'm committed to 
              developing scalable solutions that drive efficiency, improve decision-making processes, and create meaningful 
              impact through innovative AI and machine learning applications. My goal is to support evidence-based 
              policymaking and help organizations make data-driven decisions.
            </SectionContent>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.6 }}
            theme={theme}
          >
            <SectionHeader>
              <SectionIcon theme={theme}>
                <FiBookOpen />
              </SectionIcon>
              <SectionTitle theme={theme}>My Journey</SectionTitle>
            </SectionHeader>
            <Timeline theme={theme}>
              <TimelineItem>
                <TimelineYear theme={theme}>2023 - Present</TimelineYear>
                <TimelineText theme={theme}>
                  Software Developer at Intact Insurance, Toronto - Developing AI-driven automation solutions and scalable backend services for large-scale data processing.
                </TimelineText>
              </TimelineItem>
              <TimelineItem>
                <TimelineYear theme={theme}>2022 - 2023</TimelineYear>
                <TimelineText theme={theme}>
                  Master's in Computer Science with AI Specialization at Western University (4.0 GPA) - Focused on advanced AI/ML techniques and research.
                </TimelineText>
              </TimelineItem>
              <TimelineItem>
                <TimelineYear theme={theme}>2019 - 2022</TimelineYear>
                <TimelineText theme={theme}>
                  Full Stack Developer at Tata Consultancy Services - Developed NLP-based solutions and received Employee of the Year Award.
                </TimelineText>
              </TimelineItem>
              <TimelineItem>
                <TimelineYear theme={theme}>2015 - 2019</TimelineYear>
                <TimelineText theme={theme}>
                  B.Tech in Computer Science (with Honors) - Laid the foundation for my technical expertise and passion for innovation.
                </TimelineText>
              </TimelineItem>
            </Timeline>
          </AboutSection>

          <AboutSection
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.8 }}
            theme={theme}
          >
            <SectionHeader>
              <SectionIcon theme={theme}>
                <FiHeart />
              </SectionIcon>
              <SectionTitle theme={theme}>What Drives Me</SectionTitle>
            </SectionHeader>
            <SectionContent theme={theme}>
              Innovation, continuous learning, and making a positive impact through technology. I'm constantly exploring 
              new frameworks, methodologies, and emerging technologies to stay at the forefront of the industry. 
              Every challenge is an opportunity to grow, and every project is a chance to create something meaningful 
              that can help organizations make better decisions through data-driven insights.
            </SectionContent>
          </AboutSection>
      </StoryContent>
    </StoryContainer>
  );
};

export default MyStory;
